import React, { useEffect, useState } from 'react';
import { View, Text, StyleSheet, Pressable } from 'react-native';
import socketService from './services/socket';
import { loadStripe } from '@stripe/stripe-js';

// Initialize Stripe only if public key is available
const stripePromise = process.env.REACT_APP_STRIPE_PUBLIC_KEY 
  ? loadStripe(process.env.REACT_APP_STRIPE_PUBLIC_KEY)
  : null;

if (!process.env.REACT_APP_STRIPE_PUBLIC_KEY) {
  console.warn('Stripe public key not found. Please add REACT_APP_STRIPE_PUBLIC_KEY to your environment variables.');
}

const App = () => {
  const [formId, setFormId] = useState(null);
  const [showForm, setShowForm] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Connect to WebSocket when component mounts
    socketService.connect();

    // Listen for checkout URL from server
    const handleCheckout = async (data) => {
      try {
        const { checkoutUrl, formId } = data;

        if (!stripePromise) {
          throw new Error('Stripe is not properly initialized');
        }

        setFormId(formId);

        // Redirect to Stripe Checkout
        window.location.href = checkoutUrl;
      } catch (err) {
        setError('Failed to initialize payment. Please try again.');
        console.error('Checkout error:', err);
      }
    };

    // Listen for payment success
    const handlePaymentSuccess = (data) => {
      if (data.formId === formId) {
        // Handle successful payment (e.g., show success message)
        console.log('Payment successful!');
        setError(null);
      }
    };

    socketService.addActionListener('SHOW_CHECKOUT', handleCheckout);
    socketService.addActionListener('PAYMENT_SUCCESS', handlePaymentSuccess);

    // Cleanup on unmount
    return () => {
      socketService.removeActionListener('SHOW_CHECKOUT', handleCheckout);
      socketService.removeActionListener('PAYMENT_SUCCESS', handlePaymentSuccess);
      socketService.disconnect();
    };
  }, [formId]);

  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <Text style={[styles.logo, styles.calSans]}>AI YETI</Text>
        <View style={styles.nav}>
          <Pressable style={styles.navItem}><Text style={[styles.navText, styles.calSans]}>How It Works</Text></Pressable>
          <Pressable style={styles.navItem}><Text style={[styles.navText, styles.calSans]}>Pricing</Text></Pressable>
          <Pressable style={[styles.navItem, styles.ctaButton]}><Text style={[styles.ctaText, styles.calSans]}>Get Started</Text></Pressable>
        </View>
      </View>

      <View style={styles.hero}>
        <Text style={[styles.heroTitle, styles.calSans]}>Get greeted by the Yeti!</Text>

        {error && (
          <Text style={styles.errorMessage}>{error}</Text>
        )}

        <View style={styles.formSection}>
          <View style={styles.formContainer}>
            {showForm && (
              <div dangerouslySetInnerHTML={{
                __html: '<heyflow-wrapper flow-id="QZS4xUEaV1wbK9tOWtH6" scroll-up-on-navigation style-config=\'{"width":"800px","height":"550px"}\'></heyflow-wrapper>'
              }} />
            )}
          </View>
          <img 
            src="/images/yeti_3.png" 
            alt="Friendly AI Yeti"
            style={styles.yetiImage}
          />
        </View>
      </View>

      <View style={styles.footer}>
        <Text style={[styles.footerText, styles.calSans]}>© 2024 Pixel Party. All rights reserved.</Text>
        <Text style={[styles.footerText, styles.calSans]}>Made with ❤️ by the Yeti!</Text>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#FAFAFA',
    minHeight: '100vh',
    position: 'relative',
  },
  header: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: 12,
    paddingHorizontal: 40,
    backgroundColor: 'white',
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.1,
    shadowRadius: 4,
  },
  logo: {
    fontSize: 20,
    fontWeight: '600',
    color: '#2D3748',
  },
  nav: {
    flexDirection: 'row',
    alignItems: 'center',
    gap: 20,
  },
  navItem: {
    padding: 8,
  },
  navText: {
    color: '#4A5568',
    fontSize: 14,
    fontWeight: '600',
  },
  ctaButton: {
    backgroundColor: '#3182CE',
    borderRadius: 8,
    paddingHorizontal: 16,
    paddingVertical: 8,
  },
  ctaText: {
    color: 'white',
    fontWeight: '600',
  },
  hero: {
    flex: 1,
    alignItems: 'center',
    backgroundColor: '#FAFAFA',
    paddingTop: 20,
  },
  heroTitle: {
    fontSize: 48,
    fontWeight: '600',
    color: '#2D3748',
    lineHeight: 60,
    textAlign: 'center',
    marginBottom: 20,
  },
  formSection: {
    position: 'relative',
    width: '100%',
    maxWidth: 800,
    alignItems: 'center',
  },
  formContainer: {
    width: '100%',
    backgroundColor: '#FAFAFA',
    borderRadius: 16,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 4 },
    shadowOpacity: 0.1,
    shadowRadius: 12,
    alignItems: 'center',
    justifyContent: 'center',
    zIndex: 1,
  },
  yetiImage: {
    position: 'absolute',
    bottom: -100,
    right: -100,
    width: 400,
    height: 'auto',
    objectFit: 'contain',
    zIndex: 0,
  },
  calSans: {
    fontFamily: 'Cal Sans',
  },
  footer: {
    position: 'absolute',
    bottom: 0,
    left: 0,
    right: 0,
    padding: 12,
    backgroundColor: '#FAFAFA',
    alignItems: 'center',
    justifyContent: 'center',
    gap: 4,
  },
  footerText: {
    fontSize: 12,
    color: '#4A5568',
    textAlign: 'center',
  },
  errorMessage: {
    color: '#E53E3E',
    fontSize: 16,
    marginBottom: 20,
    textAlign: 'center',
    fontFamily: 'Cal Sans',
  },
});

export default App;
